  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides a hydrogeomorphic
  (HGM) evaluation of ecosystem restoration and management options for the Clarence
  Cannon and Great River National Wildlife Refuges (NWRs) along Pools 20-25 of the
  Upper Mississippi River System in northeast Missouri and west central Illinois.
  This three step process outlines the historical landscape, contemporary changes
  from presettlement conditions, restoration and management options and monitoring
  and evaluation needs for the Refuges. Topics include geomorphology, soils, topography/elevation,
  climate, vegetation and hydrology.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
